import React, { useState } from 'react';
import { propertyData, getUniqueLocations } from './data';
import './App.css';

const availableLocations = getUniqueLocations(propertyData);

/* -------------------- PROPERTY CARD -------------------- */
const PropertyCard = ({ property }) => {
    if (!property) return null;

    const originalPrice = property.price;
    const predictedPrice = property.predicted_price;

    const formattedOriginal =
        typeof originalPrice === 'number'
            ? originalPrice.toLocaleString('en-US', {
                  style: 'currency',
                  currency: 'USD',
                  maximumFractionDigits: 0,
              })
            : null;

    const formattedPredicted =
        typeof predictedPrice === 'number'
            ? predictedPrice.toLocaleString('en-US', {
                  style: 'currency',
                  currency: 'USD',
                  maximumFractionDigits: 0,
              })
            : null;

    return (
        <div className="property-card">
            <h3 className="card-label">{property.title}</h3>

            <img
                src={property.image_url}
                alt={property.title}
                className="property-image"
            />

            <div className="card-details">
                {/* Price + stats row */}
                <div className="price-row">
                    <div className="price-column">
                        <div className="predicted-price">
                            Predicted: {formattedPredicted || '—'}
                        </div>

                        {formattedOriginal && (
                            <div className="original-price">
                                Original: {formattedOriginal}
                            </div>
                        )}
                    </div>

                    <div className="stats-row">
                        <span>
                            <strong>{property.bedrooms}</strong> bds
                        </span>
                        <span>|</span>
                        <span>
                            <strong>{property.bathrooms}</strong> ba
                        </span>
                        <span>|</span>
                        <span>
                            <strong>
                                {property.size_sqft.toLocaleString()}
                            </strong>{' '}
                            sqft
                        </span>
                    </div>
                </div>

                {/* Location */}
                <div className="address-text">{property.location}</div>

                {/* Amenities */}
                <div
                    style={{
                        borderTop: '1px solid #e0e0e0',
                        paddingTop: '10px',
                    }}
                >
                    <ul className="amenities-list">
                        {property.amenities.map((amenity, index) => (
                            <li key={index}>{amenity}</li>
                        ))}
                    </ul>
                </div>
            </div>
        </div>
    );
};

/* -------------------- MAIN COMPONENT -------------------- */
const PropertyComparison = () => {
    const [location1, setLocation1] = useState('');
    const [location2, setLocation2] = useState('');
    const [comparisonProps, setComparisonProps] = useState({
        prop1: null,
        prop2: null,
    });

    const handleCompare = async () => {
        if (!location1 || !location2 || location1 === location2) {
            setComparisonProps({ prop1: null, prop2: null });
            return;
        }

        try {
            const res = await fetch('http://127.0.0.1:8000/compare', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({
                    address1: location1,
                    address2: location2,
                }),
            });

            const data = await res.json();

            const backendA = data?.result?.address1 || null;
            const backendB = data?.result?.address2 || null;

            const localA =
                propertyData.find((p) => p.location === location1) || null;
            const localB =
                propertyData.find((p) => p.location === location2) || null;

            const mergedA = backendA
                ? { ...(localA || {}), ...backendA }
                : localA;

            const mergedB = backendB
                ? { ...(localB || {}), ...backendB }
                : localB;

            setComparisonProps({
                prop1: mergedA,
                prop2: mergedB,
            });
        } catch (err) {
            console.error('Compare failed', err);
            setComparisonProps({ prop1: null, prop2: null });
        }
    };

    return (
        <div className="property-comparison-app">
            <header className="app-header">
                <h1 className="header-title">
                    Property Comparison & Price Prediction App
                </h1>

                <div className="input-group">
                    <select
                        className="location-input"
                        value={location1}
                        onChange={(e) => setLocation1(e.target.value)}
                    >
                        <option value="">Select location</option>
                        {availableLocations.map((loc) => (
                            <option key={loc} value={loc}>
                                {loc}
                            </option>
                        ))}
                    </select>

                    <span className="vs-label">vs</span>

                    <select
                        className="location-input"
                        value={location2}
                        onChange={(e) => setLocation2(e.target.value)}
                    >
                        <option value="">Select location</option>
                        {availableLocations.map((loc) => (
                            <option key={loc} value={loc}>
                                {loc}
                            </option>
                        ))}
                    </select>

                    <button
                        className="compare-button"
                        onClick={handleCompare}
                        disabled={
                            !location1 ||
                            !location2 ||
                            location1 === location2
                        }
                    >
                        Compare
                    </button>
                </div>
            </header>

            {/* Only render cards AFTER compare */}
            {(comparisonProps.prop1 || comparisonProps.prop2) && (
                <main className="comparison-container">
                    <PropertyCard property={comparisonProps.prop1} />
                    <PropertyCard property={comparisonProps.prop2} />
                </main>
            )}
        </div>
    );
};

export default PropertyComparison;
